ontology_addendum.graph:
@prefix co: <https://example.com/ont_cqf#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix schema1: <http://schema.org/> .

co:CoolingTechnique a rdfs:Class ;
    rdfs:label "Cooling Technique" ;
    rdfs:comment "Techniques used to achieve low temperatures, such as liquid helium cooling." ;
    rdfs:subClassOf co:ExperimentalTechnique .

co:ExperimentalTechnique a rdfs:Class ;
    rdfs:label "Experimental Technique" ;
    rdfs:comment "Methods used to conduct experiments in cryogenics and quantum physics." ;
    rdfs:subClassOf schema1:Method .

co:LowTemperaturePhysics a rdfs:Class ;
    rdfs:label "Low Temperature Physics" ;
    rdfs:comment "A field of physics that studies the behavior of materials at temperatures approaching absolute zero." ;
    rdfs:subClassOf schema1:Science .

co:QuantumFluids a rdfs:Class ;
    rdfs:label "Quantum Fluids" ;
    rdfs:comment "Fluids that exhibit quantum mechanical effects at macroscopic scales, typically at very low temperatures." ;
    rdfs:subClassOf co:LowTemperaturePhysics .

co:Superconductivity a rdfs:Class ;
    rdfs:label "Superconductivity" ;
    rdfs:comment "A phenomenon where a material exhibits zero electrical resistance and expulsion of magnetic fields at low temperatures." ;
    rdfs:subClassOf co:LowTemperaturePhysics .

co:CryogenicsOntology a owl:Ontology ;
    rdfs:label "Cryogenics and Quantum Fluids Ontology" ;
    rdfs:comment "This ontology provides a structured representation of concepts and relationships in the field of cryogenics and quantum fluids, focusing on low-temperature physics, superconductivity, and experimental techniques." ;
    owl:versionInfo "0.1.0" .

co:Measurement a rdf:Property ;
    rdfs:label "Measurement" ;
    rdfs:comment "Quantitative assessment of physical properties in experiments." ;
    rdfs:domain co:ExperimentalTechnique ;
    rdfs:range schema1:Float .

co:SuperconductingTransitionTemperature a rdf:Property ;
    rdfs:label "Superconducting Transition Temperature" ;
    rdfs:comment "The temperature at which a material transitions into a superconducting state." ;
    rdfs:domain co:Superconductivity ;
    rdfs:range schema1:Float .
